import React from 'react';
import './card-list.style.css';

export const CardList = (props) => {  // Functional component
    return <div className='card-list'>          {props.state.monsters.map(monster => (
        <h1 key={monster.id}> {monster.name} </h1>
    ))}</div>;
}
